import axios from 'axios';

function getNfts() {
  const nfts = axios
    .get('https://api.elrond.com/nfts?size=10000&collection=EQUISTAR-3f393f')
    .then((res) => {
      return res.data;
    });
  return nfts.json();
}

export { getNfts };
